class App extends React.Component{
  constructor(){
    super();
    this.todoItems = [
      'Mua bim bim',
      'Di da bong',
      'Di choi'
    ];
  }
  render() {
    return (
    <div className="App">
      <p>
        {
          this.todoItems.map((item, key) => <TodoList key={key}/>)
        }
      </p>
    </div>
    );
  }
}

export default App;
